import pic from "./dp.svg"
import logo from "./logo1.svg"
import { Navigate,useNavigate } from "react-router-dom"
const Dashboard = () => {
    let navigate = useNavigate()
    const logout=()=>{
        localStorage.removeItem("login")
        navigate("/")
        location.reload();
        // <Navigate to="/"></Navigate>
    }
 return (

    <div className="dp">
        <nav className="navbar">
        <div className="logo">
            <img src={logo} alt="reddit" className="image"/>
        </div>
        <div className="items">
            <ul>Home</ul>
            <ul>About</ul>
            <ul>Services</ul>
            <ul>Contact</ul>
            <ul onClick={logout}>Logout</ul>
        </div>
        </nav>
        <img src={pic} alt="dp" className="img_dp"/>
    </div>
 );
}
export default Dashboard;
